def main():
    n = int(input())
    verdicts = [input() for _ in range(n)]
    ac, wa, tle, re = 0, 0, 0, 0
    for v in verdicts:
        if v == 'AC':
            ac += 1
        elif v == 'WA':
            wa += 1
        elif v == 'TLE':
            tle += 1
        else:
            re += 1
    print('AC x {}'.format(ac))
    print('WA x {}'.format(wa))
    print('TLE x {}'.format(tle))
    print('RE x {}'.format(re))

if __name__ == '__main__':
    main()

